import React from "react";
import { useParams, Link } from "react-router-dom";
import Header from "./Header";

const CityInfo = (props) => {
  const params = useParams();

  return (
    <React.Fragment>
      <Header></Header>
      <Link to="/">
        <h2>{params.city}</h2>
      </Link>
    </React.Fragment>
  );
};

export default CityInfo;
